import CampoTexto from "../CampoTexto";
import Lista from "../listaPosição";

const Formulario = () => {
    const posicao = [
        "Atacante",
        "Goleiro",
        "Zagueiro",
        "Tecnico",
        "Capitão"
    ]
    return(
        <section>
            <form>
                <CampoTexto placeholder="Nome" label="Nome"/>
                <CampoTexto placeholder="url da imagem" label="url da imagem"/>
                <CampoTexto placeholder="posição" label="posição"/>
                <Lista itens={posicao}/>
            </form>
        </section>
    )
}
export default Formulario;
